INSERT INTO host(name, lives_in, works, about, phone, email, is_superHost) VALUES ('Fernando Castro', 'oceanside, California, United States', 'Real Estate', 'This property encompasses some very unique features.  Nestled at the end of a cul-de-sac. To get up to the property you must go up a long drive way that puts you up on a hill and reveals the home with its one of a kind views of the ocean and Carlsbad Lagoon. This home gives you all the privacy you need to enjoy your vacation undisturbed. It includes a beautiful interior with a fully remodeled kitchen, and has a pool with an attached Jacuzzi, mini waterfall, and waterslide in the backyard. While staying in this home you may also rent bikes and surfboards from the garage for some extra beach fun. Must be 21+ to rent this property.' , (678)-270-1232, 'FakeEmail@yahoo.com', TRUE);
